import './Header.css';

function Header() {
  return (
    <header className="header">
        <div class="header__logo">
            <a class="header__logo-link" href="#">
                 <img class="header_logo-img" src="assets/img/svg/odigo-Logo.svg" alt="Discover Amazing places in Japan" />
            </a>
        </div>

        <nav class="navbar">
          <ul>
            <li><a class="nav__link" href="#articles">Articles</a></li>
            <li><a class="nav__link" href="#locations">Locations</a></li>
            <li><a class="nav__link" href="#videos">Videos</a></li>
            <li><a class="nav__link" href="#signin">Sign in</a></li>
          </ul>
        </nav>

     </header>

  );
}

export default Header;
